import React, {useEffect} from 'react'
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import axios from 'axios'
import Autocomplete from './components/Autocomplete'



import logo from './logo.svg';
import './App.css';

function App() {


  const students = axios.get('/students')
  .then(resp => setAllStudents(resp.data.test2))

  useEffect(() => {

    axios.get('/students')
    .then(resp => setAllStudents(resp.data.test2))
}, [])

  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <h1>Student Search</h1>
          <Autocomplete students={students}></Autocomplete>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
